      SELECT DISTINCT - CAST ( NULL AS INTEGER ) * - col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL = NULL OR NOT NULL < ( - col2 );
  - name: tab0

outputs:
